description:
On this dvd, Cory gives you a rare look into his approach and styling to his music on both organ and piano. we also provide you a new technology called Study Motion which allows you to watch the video in half time but retaining the correct pitch.Cory covers solos, chord voicings,hymns,shouts and much more......
